import React from "react";
import "./Chart.css";
import ChartBar from "./ChartBar";

function Chart(props) {
  return (
    <div className="chart">
      {props.dataPoints.map((dataPoint) => {
        return (
          <ChartBar
            key={dataPoint.date}//Months
            value={dataPoint.amount} //Amount
            maxValue={null}
            label={dataPoint.date}// Months
          />
        );
      })}
    </div>
  );
}

export default Chart;
